import styled from 'styled-components';
import Link from 'next/link';

const HeaderStyled = styled.header`
  position: fixed;
  background-color: #050505;
  width: 100%;
  display: flex;
  align-items: center;
  justify-content: center;
  flex-direction: column;

  a {
    margin: 0;
    padding: 20px;
  }
`;

const Logo = styled.img`
  width: 100%;
  max-width: 500px;
`;

const NavUl = styled.ul`
  display: flex;
  align-items: center;

  flex-direction: row;
  margin: 0;
  padding: 0;

  a {
    margin: 5px;
    list-style-type: none;
    margin: 0;
    padding: 0;
    text-decoration: none;
    color: #75757c;
  }

  a:hover {
    color: white;
  }
`;

export default function Header() {
  return (
    <>
      <HeaderStyled>
        <Link href="/">
          <a>
            <Logo src="/bookcaselogo.png" alt="bookcase logo" />
          </a>
        </Link>
        <nav>
          <NavUl>
            <Link href="/">
              <a>
                <li>Home</li>
              </a>
            </Link>
            <Link href="/">
              <a>
                <li>Add Book</li>
              </a>
            </Link>
            <Link href="/">
              <a>
                <li>Show Books</li>
              </a>
            </Link>
          </NavUl>
        </nav>
      </HeaderStyled>
    </>
  );
}
